"use strict";
eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   project_slugs: () => (/* binding */ project_slugs),\n/* harmony export */   projects: () => (/* binding */ projects),\n/* harmony export */   series: () => (/* binding */ series)\n/* harmony export */ });\nconst projects = {\n    \"sailor-moon-shirt\": {\n        title: \"Sailor Moon Shirt\",\n        description: \"The Sailor Moon Series, 2024\",\n        images: [\n            \"/sailor-moon-muslin-1.jpg\",\n            \"/sailor-moon-muslin-2.jpg\",\n            \"/sailor-moon-shirt-1.jpg\",\n            \"/sailor-moon-shirt-2.jpg\",\n            \"/sailor-moon-shirt-3.jpg\"\n        ],\n        details: [\n            \"The following installations dug deeply into the iconic, magical realm of Sailor Moon. Following a teenage girl named Usagi Tsukino, who finds out she's a celestial warrior, set to save the world from all evil. This project is a blend of a constructed wearable art and a sculptural 3-D element. \\n\\n\",\n            \"At the heart of the collection is an inspired fashion-designed shirt and a replicated wand, similar to the ones seen in the television series. Using fabric manipulations, pattern drafting, and sewing techniques for the construction of the dressed shirt. As well as playing with 3-D and 2-D platforms such as Autodesk Maya for the construction of the base and Adobe Illustrator for the laser printed gems, in the currations of the wand. Each piece is a letter to femininity, strength, and enchantment, inviting wearers to step into their own power, similar to a magical girl ready to transform under the moonlight.\\n\"\n        ]\n    },\n    \"sailor-moon-wand\": {\n        title: \"Sailor Moon Wand\",\n        description: \"The Sailor Moon Series, 2024\",\n        images: [\n            \"/wand-prod-1.png\",\n            \"/wand-prod-2.png\",\n            \"/wand-1.jpg\",\n            \"/wand-2.jpg\"\n        ],\n        details: [\n            \"The following installations dug deeply into the iconic, magical realm of Sailor Moon. Following a teenage girl named Usagi Tsukino, who finds out she's a celestial warrior, set to save the world from all evil. This project is a blend of a constructed wearable art and a sculptural 3-D element. \\n\\n\",\n            \"At the heart of the collection is an inspired fashion-designed shirt and a replicated wand, similar to the ones seen in the television series. Using fabric manipulations, pattern drafting, and sewing techniques for the construction of the dressed shirt. As well as playing with 3-D and 2-D platforms such as Autodesk Maya for the construction of the base and Adobe Illustrator for the laser printed gems, in the currations of the wand. Each piece is a letter to femininity, strength, and enchantment, inviting wearers to step into their own power, similar to a magical girl ready to transform under the moonlight.\\n\"\n        ]\n    },\n    \"plus-size-body\": {\n        title: \"Drawing on a Plus Size Body\",\n        description: \"Fashion Sketches and Flats, 2024\",\n        images: [\n            \"/plus-size-1.png\",\n            \"/plus-size-2.png\",\n            \"/plus-size-3.png\",\n            \"/plus-size-4.png\",\n            \"/plus-size-5.png\",\n            \"/plus-size-6.png\"\n        ],\n        details: \"This project will use a range of methods, including expressive line work, contouring, shading, and gesture drawing, to depict the movement of various plus-sized figures. The intention is to appreciate each body's unique proportions, curves, and postures in different sorts of garments. While also curating hand drawn flats to better understand the true shapes of each piece. \"\n    },\n    \"man-best-friend\": {\n        title: \"A Man's Best Friend\",\n        description: \"Fashion Sketches and Flats, 2024\",\n        images: [\n            \"/dog-fashion-1.png\",\n            \"/dog-fashion-2.png\",\n            \"/dog-fashion-3.png\",\n            \"/dog-fashion-4.png\",\n            \"/dog-fashion-5.png\",\n            \"/dog-fashion-6.png\",\n            \"/dog-fashion-7.png\",\n            \"/dog-fashion-8.png\"\n        ],\n        details: \"With this collection, I chose to explore the idea of posthumanism through the relationship between dogs and humans. Owning a dog myself, I understand the deep bond that humans and their pets have intertwined. In many cases, dogs aren't seen as just an individual's pet, but a part of their family. In an article written by Annamari Vanska \\\" Cause I Wuv You! Pet dog Fashion and Emotional Consumption,\\\" the writer speaks on the ways in which pet consumerism reflects and influences the intricate emotional relationship between humans and their dogs. It investigates the ways in fashion serves to express and commercialize relationships, uncovering more profound social and psychological aspects of companionship. For my final collection, I chose certain materiality and crafts to represent the warm and comforting feeling one gets when around their dog. Showing the ways in which fashion can relate to emotional values.\"\n    },\n    \"open-heart\": {\n        title: \"Open Heart\",\n        description: \"Sewing Series, 2024\",\n        images: [\n            \"/open-heart-muslin-1.jpg\",\n            \"/open-heart-muslin-2.jpg\",\n            \"/open-heart-muslin-3.jpg\",\n            \"/open-heart-1.jpg\",\n            \"/open-heart-2.jpg\",\n            \"/open-heart-3.jpg\",\n            \"/open-heart-4.jpg\"\n        ],\n        details: [\n            \"With this next garment, I wanted to push the boundaries of my craftsmanship and technical skills. One of the most exciting aspects of this piece was experimenting with playful shapes within the dresss silhouette, which ultimately led to the successful creation of the heart shape.\",\n            \"The most striking feature of this design is undoubtedly the intricate beadwork outlining these shapes. While visually captivating, it also proved to be the most challenging element. The beading alone required 15 hours of meticulous work, in addition to the garments construction. Despite the complexity, this detail elevates the piece, adding depth, texture, and a sense of artistry that makes the final design truly special.\"\n        ]\n    },\n    \"romantic-dream\": {\n        title: \"A Romantic Dream\",\n        description: \"Sewing Series, 2024\",\n        images: [\n            \"/romantic-dream-muslin-1.jpg\",\n            \"/romantic-dream-muslin-2.jpg\",\n            \"/romantic-dream-muslin-3.jpg\",\n            \"/romantic-dream-1.jpg\",\n            \"/romantic-dream-2.jpg\",\n            \"/romantic-dream-3.jpg\"\n        ],\n        details: \"My father used to read me fairytale stories every night before bed when I was a child. I was enthralled by the princesses' ethereal silhouettes and fell in love with the grace and elegance of their gowns. I was inspired to create a skirt with a striking bow at the back and soft pleats, which perfectly captured the charming feel I've always adorned from my childhood.\"\n    },\n    \"knit-dress\": {\n        title: \"Knit Dress\",\n        description: \"Sewing Series, 2025\",\n        images: [\n            \"/knit1.png\",\n            \"/knit2.png\",\n            \"/knit3.png\",\n            \"/knit4.png\",\n            \"/knit5.png\",\n            \"/knit6.png\"\n        ],\n        details: \"This dress was solely made by draping techniques. I began by carefully manipulating the fabric into a dress like form, then marked each specific pleat to transfer the exact shape of the dress. After pinning together the marked dress, I began overlocking each seam to complete the garment. I then adorned the dress with buttons and gems to put the look together.\"\n    },\n    \"lifescape-book\": {\n        title: \"Lifescape Book\",\n        description: \"Fine Arts, 2024\",\n        images: [\n            \"/lifescape-1.jpg\",\n            \"/lifescape-2.jpg\"\n        ],\n        details: \"Curated in my first year drawing and imaging course, we were asked to create a lifescape book of a certain personal experience in our life so far. My idea stemmed from my journey moving across the country from California to New York. I made the decision to combine the Brooklyn Bridge and the Golden Gate, two of the most iconic sites that symbolize each city. While also taking into account the differences between my current city life and the suburban area I grew up in. I wanted this piece to reflect how deeply my culture has shaped my identity. To honor that, I chose to incorporate glimpses of different aspects of my life, weaving them together as a tribute to my roots and experiences.\"\n    },\n    \"cruelty-fast-fashion\": {\n        title: \"The Cruelty of Fast Fashion\",\n        description: \"Fine Arts, 2024\",\n        images: [\n            \"/fast-fashion-1.jpg\",\n            \"/fast-fashion-2.jpg\"\n        ],\n        details: \"This shadow box is representational of the harm fast fashion has caused on our planet. To keep up with society's latest trends, companies such as Shien or Fashion Nova have made it their mission to create a new line of clothing every other week. And with the use of cheap labor and fabric these businesses have been able to keep up with the demand, while also charging close to nothing for their products. Companies would place steep discounts on their products to encourage consumerism and mass buying. People could purchase multiple items of these companies for the same cost of one sustainable brand. Furthermore, cheap products, made from cheap materials, can only be worn for a limited amount of time before being destroyed by daily life and activities. They then end up in one of the many landfills that pollute our environment and the Earth. The decomposition of fast fashion products in landfills increases the number of methane gasses in our atmosphere. This leads to drastic changes in climate control. These landfills become Pollution Closets. Kaseys Kloset is a depiction of the effects of fast fashion and its negative effects on society. The garments are made of used scraps of felt. The trash bins located on the inside of the closet were obtained from past project supplies that had been taken apart. And with that, I hope this piece brings attention to the effects of mass consumerism of fast fashion as well as bring to light the importance of sustainability as a means to protect the environment.\"\n    },\n    \"layers-of-meaning\": {\n        title: \"Layers of Meaning\",\n        description: \"Fine Arts, 2024\",\n        images: [\n            \"/layers-meaning-1.jpg\",\n            \"/layers-meaning-2.jpg\"\n        ],\n        details: \"For this research, I choose to analyze the Vietnamese artist Min's song C\\xe0 Ph\\xea. This upbeat song tells the story of a woman who waits for someone who never arrives. I choose to make an artwork that symbolizes this division because the tune speaks to around three different emotional periods. Her happiness after a first kiss is the first phase; she next experiences longing and confusion over why the man hasn't texted her back; and last, she experiences heartbreak when he never returns. Using Adobe Illustrator and a high precision, laser cutting machine, I began designing the elements to my piece. For the concept, a lot of it was geared towards a visual aspect. I wanted people to recognize all the layers and etchings that this design has to it, making individuals wonder; how does it make them feel? Do they experience a sense of anxiety, joy, or sorrow?\\n\"\n    }\n};\nconst project_slugs = [\n    {\n        category: \"sailor-moon-series\",\n        slug: \"sailor-moon-shirt\",\n        title: \"Sailor Moon Shirt\",\n        description: \"The Sailor Moon Series\",\n        year: \"2024\",\n        thumbnail: \"/sailor-moon-shirt-1.jpg\"\n    },\n    {\n        category: \"sailor-moon-series\",\n        slug: \"sailor-moon-wand\",\n        title: \"Sailor Moon Wand\",\n        description: \"The Sailor Moon Series\",\n        year: \"2024\",\n        thumbnail: \"/wand-1.jpg\"\n    },\n    {\n        category: \"fashion-sketches-and-flats\",\n        slug: \"plus-size-body\",\n        title: \"Drawing on a Plus Size Body\",\n        description: \"Fashion Sketches and Flats\",\n        year: \"2024\",\n        thumbnail: \"/plus-size-1.png\"\n    },\n    {\n        category: \"fashion-sketches-and-flats\",\n        slug: \"man-best-friend\",\n        title: \"A Man's Best Friend\",\n        description: \"Fashion Sketches and Flats\",\n        year: \"2023\",\n        thumbnail: \"/dog-fashion-1.png\"\n    },\n    {\n        category: \"sewing-series\",\n        slug: \"open-heart\",\n        title: \"Open Heart\",\n        description: \"Sewing Series\",\n        year: \"2024\",\n        thumbnail: \"/open-heart-1.jpg\"\n    },\n    {\n        category: \"sewing-series\",\n        slug: \"romantic-dream\",\n        title: \"A Romantic Dream\",\n        description: \"Sewing Series\",\n        year: \"2024\",\n        thumbnail: \"/romantic-dream-1.jpg\"\n    },\n    {\n        category: \"sewing-series\",\n        slug: \"knit-dress\",\n        title: \"Knit Dress\",\n        description: \"Sewing Series\",\n        year: \"2025\",\n        thumbnail: \"/knit3.png\"\n    },\n    {\n        category: \"fine-arts-series\",\n        slug: \"lifescape-book\",\n        title: \"Lifescape Book\",\n        description: \"Fine Arts\",\n        year: \"2024\",\n        thumbnail: \"/lifescape-2.jpg\"\n    },\n    {\n        category: \"fine-arts-series\",\n        slug: \"cruelty-fast-fashion\",\n        title: \"The Cruelty of Fast Fashion\",\n        description: \"Fine Arts\",\n        year: \"2024\",\n        thumbnail: \"/fast-fashion-1.jpg\"\n    },\n    {\n        category: \"fine-arts-series\",\n        slug: \"layers-of-meaning\",\n        title: \"Layers of Meaning\",\n        description: \"Fine Arts\",\n        year: \"2024\",\n        thumbnail: \"/layers-meaning-1.jpg\"\n    }\n];\nconst series = [\n    {\n        slug: \"sailor-moon-series\",\n        category: \"sailor-moon-series\",\n        title: \"Sailor Moon Series\",\n        year: \"2024\",\n        thumbnail: \"/series-1.png\"\n    },\n    {\n        slug: \"fashion-sketches-and-flats\",\n        category: \"fashion-sketches-and-flats-series\",\n        title: \"Fashion Sketches and Flats\",\n        year: \"2024\",\n        thumbnail: \"/series-2.png\"\n    },\n    {\n        slug: \"sewing-series\",\n        category: \"sewing-series\",\n        title: \"Sewing Series\",\n        year: \"2024\",\n        thumbnail: \"/series-3.png\"\n    },\n    {\n        slug: \"fine-arts-series\",\n        category: \"sewing-series\",\n        title: \"Fine Arts Series\",\n        year: \"2024\",\n        thumbnail: \"/series-4.png\"\n    }\n];\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(rsc)/./app/projects.ts\n");

